import React, { useEffect, useState } from 'react';
import { Typography, Card, CardContent } from '@mui/material';

const ActiveUsers = () => {
    const [users, setUsers] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        fetch('http://${config.server_host}:${config.server_port}/active_users') // Use your actual server host and port
            .then(res => res.json())
            .then(data => {
                setUsers(data);
                setLoading(false);
            })
            .catch(err => {
                console.error('Failed to fetch active users:', err);
                setError(err);
                setLoading(false);
            });
    }, []);

    if (loading) return <Typography>Loading active users...</Typography>;
    if (error) return <Typography>Error loading active users!</Typography>;
    if (!users.length) return <Typography>No active users found!</Typography>;

    return (
        <div>
            <Typography variant="h4" gutterBottom>
                Active Users
            </Typography>
            {users.map(user => (
                <Card key={user.user_id} style={{ marginBottom: 8 }}>
                    <CardContent>
                        <Typography variant="h5">{user.name}</Typography>
                        <Typography color="textSecondary">
                            Reviews Count: {user.review_count}
                        </Typography>
                    </CardContent>
                </Card>
            ))}
        </div>
    );
};

export default ActiveUsers;
